full_text:
Starbucks earnings call summary:

Loyalty membership  increasing;
Non-loyalty traffic in the tank;
Company blames the consumer environment;
China also in the tank;
Company considering strategic partners there;
Starbucks also doing more delivery-only stores
Small towns!

$SBUX

Starbucks earnings call summary: 

Performance improved throughout last quarter;
Not everything needs a Siren system;
Company testing a new mobile order algorithm;
Older customers are OK, too;
Bigtime menu cuts are coming;
Company sold more coffee, less holiday beverages;
Earnings improvements later this year. 

$SBUX

McDonald's earnings call summary:

E. coli effect should be over by April;
More chicken is coming this year;
Higher traffic + weak sales = lower margins;
Broader restaurant industry having a tough 2025;
Company on track for 50k by 2027;
Beverages still have big potential. 

$MCD

RBI earnings call summary:

Franchisee profitability flat or up;
Except Firehouse;
Tim Hortons is killing it;
Faster drive-thrus yield $$$;
Better operators also yield $$$;
Bad weather does not yield $$$;
More Whopper marketing;
The sandwich sector is struggling.

$QSR

Missed a fast chunk of that Domino's call because of Starbucks but here's a rough summary:

2025 will be just like 2024;
A DoorDash deal is coming;
Carryout and aggregation will win this year (just like 24);
Franchisee per-store profit disappointing;
Dough-stretching machines. $DPZ

News this year so far in the #restaurant space:

Layoffs at Starbucks, Applebee's, Outback, Panera Bread;
Hooters possible bankruptcy;
Early-year sales weakness outside of weather.
